function show_create_team(){
    
    team_form = document.getElementById("frm_new_team") 
    if (team_form.style.display == "none") {
        team_form.style.display = "block";
    } else {
        team_form.style.display = "none";
    }  
}

function save_new_team(){

    /*agregar un nuevo item al select*/
    var slt_teams = document.getElementById("slt_teams");

    count_teams = slt_teams.length;

    /*atributos a guardar*/

    /**/
    new_dinamic_img = document.getElementById('txt_new_image')
    /*nombre*/
    new_txt_name = document.getElementById("txt_new_name")
    /*fundation*/
    new_txt_fundation = document.getElementById("txt_new_fundation")
    /*txt_review*/
    new_txt_review = document.getElementById("txt_new_review")
    /*stadium*/
    new_txt_estadium = document.getElementById("txt_new_stadium")    

    new_obj_team = []

    new_obj_team =
        {
        id: count_teams,    
        name: new_txt_name.value,
        image: new_dinamic_img.value,
        fundation: new_txt_fundation.value,
        review: new_txt_review.value,
        stadium: new_txt_estadium.value,    
        }
    
    
       
    var actual_teams = JSON.parse(localStorage.getItem('dataTeams'))
    actual_teams.push(new_obj_team)
    /*nuevo arreglo de equipos*/    
    localStorage.setItem('dataTeams',JSON.stringify(actual_teams))

    
    var option = document.createElement("option");
    option.value = new_obj_team.id;
    option.text = new_obj_team.name;
    slt_teams.add(option);
}

