function order_by_pts(){
    

    var local_teams = JSON.parse(localStorage.getItem('dataTeams'))

    local_teams.sort((a, b) => a.order - b.order)
    var tbl_teams_division = document.getElementById("tbl_teams_division").getElementsByTagName('tbody')[0];
    
    tbl_teams_division.innerHTML = "";


    local_teams.forEach(function(division) {
    
        // Insert a row in the table at the last row
        var newRow   = tbl_teams_division.insertRow(tbl_teams_division.rows.length);
    
        // Insert a cell in the row at index 0
        var row_position  = newRow.insertCell(0);
        var row_image  = newRow.insertCell(1);
        var row_team  = newRow.insertCell(2);
        var row_pj  = newRow.insertCell(3);
        var row_g  = newRow.insertCell(4);
        var row_e  = newRow.insertCell(5);
        var row_p  = newRow.insertCell(6);
        var row_gf  = newRow.insertCell(7);
        var row_gc  = newRow.insertCell(8);
        var row_pts  = newRow.insertCell(9);


        // Append a text node to the cell
        var data_position  = document.createTextNode(division.id);
        var data_image  = document.createElement('img');
        data_image.src = division.image;
        var data_team  = document.createTextNode(division.team);
        var data_pj  = document.createTextNode(division.pj);
        var data_g = document.createTextNode(division.g);
        var data_e  = document.createTextNode(division.e);
        var data_p  = document.createTextNode(division.p);
        var data_gf  = document.createTextNode(division.gf);
        var data_gc  = document.createTextNode(division.gc);
        var data_pts  = document.createTextNode(division.pts);

        row_position.appendChild(data_position);
        row_image.appendChild(data_image);
        row_team.appendChild(data_team);
        row_pj.appendChild(data_pj);
        row_g.appendChild(data_g);
        row_e.appendChild(data_e);
        row_p.appendChild(data_p);
        row_gf.appendChild(data_gf);
        row_gc.appendChild(data_gc);
        row_pts.appendChild(data_pts);
 
    });

}
